import React from "react";
import { NavLink } from "react-router-dom";
import img from "../src/image/sad1.png"
import Commom from './Commom';

const Home = () => {

    return (
      <>
       <Commom 
        name="Grouth Your Buisiness" 
        imgsrc={img} 
        visi="/services"
         btnName ="Get Started"/>
      </>
    )
  }
  export default Home;
